customCSS:
body
{
border-color:#e3e3e3;
color:#000000;
font-family:Roboto, 'Helvetica Neue', sans-serif;
font-size:1.5rem;
align:Left;
vertical-align:Top;

}

table {
box-shadow: 0 2px 4px -1px rgba(0, 0, 0, 0.2), 0 4px 5px 0 rgba(0, 0, 0, 0.14), 0 1px 10px 0 rgba(0, 0, 0, 0.12);
border-collapse: collapse;
}

table.footer {
margin-top: 2rem;
}

.export-header {
color: #0E8CD9;
}

td
{
border-color:#e3e3e3;
color:#000000;
font-family:Roboto, 'Helvetica Neue', sans-serif;
font-size:0.8rem;
align:Left;
vertical-align:Top;
padding: 10px;

}

tr {
border-bottom: 1px solid #e3e3e3
}

tr .header {
color: #757575;
font-weight: 500;
border-bottom: 2px solid #e3e3e3;
}

tr .header {
color: #757575;
font-weight: 500;
border-bottom: 2px solid #e3e3e3;
}

tr .record.header {
color: #000000;
    background-color: #757575;
font-weight: 100;
border-top: 2px solid #e3e3e3;
border-bottom: 2px solid #e3e3e3;
}

table.header-table {
margin-bottom: 10px;
}

table.header-table > tr {
border-bottom: none;
}

table.header-table td {
text-align: center;
padding-bottom: 0px;
}
table.grouped-header-table {
margin-bottom: 10px;
}

table.grouped-header-table > tr {
border-bottom: none;
}

table.summary-grouped-header-table td {
/*text-align: center;*/
text-align: left;
padding-bottom: 0px;
}

table.grouped-header-table td {
text-align: center;
/*text-align: right;*/
padding-bottom: 0px;
}

.alt, .header
{
background-color:#ffffff;
border-color:#e3e3e3;
color:#000000;
font-family:Roboto, 'Helvetica Neue', sans-serif;
font-size:0.8rem;
align:Left;
vertical-align:Top;

}
